  return (
    <div className="book-container">
      <header>
        <img src={logoImage} />
        <span>
          Welcome, <strong>Leandro</strong>!
        </span>
        <Link className="button" to="book/new">
          Add new book
        </Link>
        <button type="button">
            <></>
        </button>
      </header>
    </div>
  );
}
